import React, { Component } from 'react'
import AudioPlayer from 'react-audio-player';
import Musique from "../music/JackSparrow.mp3";
export default class Footer extends Component {
  render() {
    return (
      <div>
      <AudioPlayer 
          src={Musique}
          autoPlay
          loop
          controls
        />
        <p>Musique d'ambience</p>
        </div>
    )
  }
}
